0">\n<tbody>\n<tr style="border-bottom: 1px solid #eee;">\n<td style="width: 11.3333%; color: #777777; padding: 15px 0px 10px 15px;">商品描述</td>\n<td style="padding: 15px 15px 10px; width: 88.6667%;">{voucher_description}</td>\n</tr>\n<tr style="border-bottom: 1px solid #eee;">\n<td style="width: 11.3333%; color: #777777; padding: 10px 0px 10px 15px; vertical-align: middle;">有效期至</td>\n<td style="padding: 15px 15px 10px; width: 88.6667%; vertical-align: middle;">{voucher_expiry_date}</td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr style="height: 18px;">\n<td style="width: 100%; height: 18px; padding: 0 15px; font-size: 14px;">\n<p style="color: #777; font-size: 16px;">條款及細則</p>\n<div>Short Size e-Coffee Voucher細杯裝電子咖啡券&nbsp;</div>\n<div>This e-voucher is valid until expiry date, which is non-extendable&nbsp;</div>\n<div>This e-voucher entitles the holder to redeem any short size handcrafted beverage on menu board (hot only), except specialty coffee, liqueur coffee, bottled drinks and juices (an additional $4 will be charged per beverage to upgrade to oat milk)</div>\n<div>This e-voucher is redeemable at any Pacific Coffee in Hong Kong (except Causeway Bay Midtown and Asia World Expo coffeehouses)</div>\n<div>This e-voucher cannot be exchanged for cash or its equivalent and is not applicable to delivery services</div>\n<div>This e-voucher cannot be used in conjunction with any other promotions or privileges</div>\n<div>Customers must use the QR code to redeem the beverage, and the code is valid for one-time use only</div>\n<div>Pacific Coffee Co. Ltd. reserves the right of final decision in case of disputes&nbsp;</div>\n</td>\n</tr>\n<tr style="height: 18px;">\n<td style="width: 100%; height: 18px; padding: 15px; border-style: none; border-bottom: 1px solid #eee; font-size: 14px;">\n<div>請於有效日期前使用、逾期作廢</div>\n<div>可憑券換領菜單上任何細杯裝手調飲品一杯 (只限熱飲)，特調咖啡、酒調咖啡、樽裝飲品及果汁除外 (如欲升級選用燕麥奶，每杯飲品需額外加$4)</div>\n<div>此電子券適用於全線香港Pacific Coffee (銅鑼灣Midtown及亞洲國際博覽館分店除外)</div>\n<div>此電子券不可兌換現金及不適用於外賣遞送服務&nbsp;</div>\n<div>此電子券不可與其它優惠同時使用&nbsp;</div>\n<div>必須以電子券上的二維碼換領飲品，而此券之二維碼只可使用一次</div>\n<div>Pacific Coffee Co. Ltd. 將保留此優惠之最終決定權</div>\n</td>\n</tr>\n<tr style="height: 18px;">\n<td style="width: 100%; height: 18px; padding: 0 15px;">\n<p>門市查詢</p>\n<p>{agent_web}</p>\n</td>\n</tr>\n<tr style="height: 18px;">\n<td style="width: 100%; height: 18px; background-color: #f0f1f1; padding: 15px;"><img src="https://tx2media.rewards-centre.com/Images/b27780cd-2769-439b-9dbd-72d004cc18c3.png" width="75px" /></td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>', 'a:9:{s:6:"qrcode";s:13:"4060000022610";s:7:"barcode";s:13:"4060000022610";s:10:"agent_name";s:14:"Pacific Coffee";s:9:"agent_web";s:30:"https://www.pacificcoffee.com/";s:19:"voucher_expiry_date";N;s:23:"voucher_activation_date";N;s:19:"voucher_description";s:27:"超級優惠 - 免費贈送";s:12:"code_hd_code";s:13:"4060000022610";s:16:"code_expiry_date";s:10:"2021-05-31";}', '2020-02-25 08:51:34', '2020-02-25 08:51:34'),
